import re

def find_prime_numbers(string):

    def is_prime(n):
        if n <= 2:
            return False
        for i in range(2, int(n ** 0.5) + 1):
            if n % i == 0:
                return False
        return True
    numbers = re.findall('\\b\\d+\\b', string)
    prime_numbers = []
    for number in numbers:
        if is_prime(int(number)):
            prime_numbers.append(int(number))
    return prime_numbers

